Subscripts
Introduction
Welcome to lesson 7, Subscripts, of The Swift Fundamentals with Bob. What if I told you that you may create a shortcut?
Problem
I'd love to have a shortcut instead of calling a method.
Normal Method
Create a class called, HelloKitty which contains a method that returns a string value.
struct HelloKitty {
  func saySomething() -> String {
    return "I'm Cute"
  }
}

Create an instance and call saySomething()
let babe = HelloKitty()
babe.saySomething() // "I'm Cute"

Introducing Subscripts
Subscripts are analogous to methods. Yet, there is no name. Instead you add the keyword, subscript.
struct WeekDays {
  var days = ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday"]

  subscript(index: Int) -> String {
    return days[index]
  }  
}

Call the subscript by adding [] at the end of the instance.
let myDays = WeekDays()
myDays[0]  // "Monday"
myDays[1]  // "Tuesday"

Dictionary
When you access elements in a dictionary, it always returns an optional type.
var info = ["Height": 183, "Body Fat": 12.5, "Weight": 76]
let height = info["Height"] // height is an optional string

Artificial Dictionary
Let us access an element without returning an optional type using subscripts.
struct HealthInfo {
  var info = ["Height": 183, "Body Fat": 12.5, "Weight": 76]

  subscript(key: String) -> Double {
    if let newInfo = info[key] {
      return newInfo
    } else {
      return 0
    }
  }
}


Important: You may use guard instead.

Access Elements
Return non-optionals using the subscript method.
let bob = HealthInfo()
bob["Height"]         // 183
bob["Body Fat"]        // 12.5
bob["123456789"]       // 0

Shortcoming of Subscript
No context means = ☠️
Practical Usage

Get the number of rows in table/collection
Anything has to do with pairs and collection types

Source Code

1007-subscripts.playground

Conclusion
Now you understand the meaning of creating a shortcut. However, subscripts often leads to confusion due to no explicit name. Swift engineers recommend that brevity is not the ultimate goal. Effective communication trumps everything else.
In the next lesson, you will learn the fundamental difference between structs and classes. In other words, you will learn the meaning of reference types and value types.

course/object-oriented-swift/convenience.body:
Convenience Init
Introduction
Welcome to the first lesson of Object Oriented Swift. You will learn how to become lazy.  In other words, you become smarter and effective when it comes to initializing an object. In programming, getting lazy to write less code is in fact good for your teammates and users as long as it's readable and gets the job done. Bill Gates once mentioned, whenever there is hard work to be done, he assigns it to the laziest person as he or she is sure to find an easy way of doing it.
Problem
I'm lazy. Can we initialize quickly?
Create Class with Designated Init
Create a class called Human
class Human {
  var name: String
  init(name: String) {
    self.name = name
 }

  // Convenience init intializes the designated init method
  convenience init() {
    self.init(name: "Bob Lee")
  }
}

Convenience init initializes the designated init method by calling self.init.
Create Object
let lee = Human(name: "Bob Lee") // init(name: String)
let bob = Human() // Convenience init()

Initialize UIColor
Create an instance that stores UIColor.
import UIKit

let randomColor = UIColor(colorLiteralRed: 255/255, green: 80/255, blue: 85/255, alpha: 1)

Custom Convenience Init
Create our own convenience init that initializes the designated init by adding extension to UIColor.
extension UIColor {
 convenience init(r: Float, g: Float, b: Float) {
   self.init(colorLiteralRed: r/255, green: g/255, blue: b/255, alpha: 1)
 }
}

let myFavoriteColor = UIColor(r: 255, g: 80, b: 85)

Application

Quick initialization for open source projects
Custom convenience inits with UIKit

Source Code
2001-convenience-init.playground
Conclusion
You've learned how to become lazy and effective at the same time. Imagine, you are the owner of a library for your teammates. They no longer have to use the bloated designated init method. Instead, you may provide multiple convenience init methods so that their lives become easier. It is similar to how the Apple engineers have provided us with convenience init methods for UIColor. It's a win-win situation.
In the next lesson, you will learn how to fail initializations.

course/object-oriented-swift/computed-pr.body:
Computed Property
Introduction
Welcome to Lesson 2 of Object Oriented Swift. You will learn how to create relationships between variables. You no longer have to manage two or more variables separately. You probably have seen get and set before. If you haven't, don't you worry. I will walk you through by placing your feet on mine.
Problem
Do we have to make functions all the time to calculate something?
Atrocious Code
Unrelated functions that take up many lines. The functions below are used to calculate a radius and diameter.
func getDiameter(radius: Double) -> Double {
 return radius * 2
}
func getRadius(diameter: Double) -> Double {
 return diameter / 2
}

getDiameter(radius: 10) // return 20
getRadius(diameter: 200) // return 100
getRadius(diameter: 600) // return 300

The two functions are separate and there is no relationship . Computed Property will help you solve this problem.
Introducing Computed Property
You may create a variable that only can be read. It is also referred to as a gettable property.

Computed = calculated

Gettable Property
Create a only readable property.
class NumberClass {
  var readableNumber: Double {
    get {
      // Complex logic
      return 777
    }
  }
  var readableNumbers: Double {
    return 789
  }
}

If you attempt to modify the property, it will give you an error.
readableNumber = 10 // Error
readableNumbers = 20 // Error

Gettable and Settable Property
You may not only make a property gettable, but also settable by inserting set right after get.  Let us create a relationship between radius and diameter.
var radius: Double = 10
var diameter: Double {
  get {
    return radius * 2
  }
  set {
    radius = newValue / 2
  }  
}

newValue refers to the newly set value of diameter.  For example, when you set diameter to 100,  newValue becomes 100.
diameter = 50
radius = 100
diameter // 200

Instead of calling newValue, you may add a different name. In the example below, there is a relationship between area and side. Instead of calling newValue, let us use newArea.
import Foundation

var side: Double = 100
var area: Double {
 get {
   return side * side
 }
 set(newArea) {
   side = sqrt(newArea)
 }
}

There is a relationship between side and area.
area = 1000
side // 31.6

Applications

Grabbing and storing data the server
Propagating relationships between properties
Preventing others from manipulating your code

Source Code

2002-computed-property.playground

Conclusion
 You've learned what it means to create a gettable property that can be only read. You've also learned how to create a settable property which allows you to modify its value as well as those of others. The UIKIt framework often utilizes gettable properties to prevent us, developers, from modifying them.
In the lesson lesson, you will learn how to add an observer to a property.

